text:
결국 성인지 예산에 35조 쓴다는걸 왜 어렵게 말하냐;
부서에 배정된 금액은 1조 2천억인데 성인지 예산으로 세금 사용 권한은 35조란거잖아;
1조 정도로 알고있었는데 결국 35조를 여가부에서 사용한거구만

여자가 집에서 집안일하고 육아할때 남자들은 돈 버는데 왜 덤탱이 육아라고 하냐 진짜 아무리 이해해도 이해가 안가네 씨발 ㅋㅋ
그 돈으로 에어컨, 보일러, 온수, 전기세 마음껏 쳐 쓰면서 밥쳐먹고 선물바라고 옷입고 자면서? 남자들은 당장에 애 뺏고 이혼해라;;;
뼈빠지게 일해서 돈벌고 가족 먹여살려도 여자는 지가 독박육아, 집안일 덤탱이, 피해자 ㅇㅈㄹ 하는데 왜 같이 사냐 어휴;;;

